import React from 'react';
import styled from 'styled-components/macro';

import CategoryButton from './CategoryButton.js';
import categories from './data/categories.js';



// import Overlay from './Overlay.js';

export default function CategoryButtonsPage({children, makeAppear, makeAppearCategory})
  {


  return (
    <div>
      <Spacer />
        <CategoryButtonArea >
          <CatButton onClick={() => makeAppear(0)}>{categories[0]}</CatButton>
          <CatButton onClick={() => makeAppear(1)}>{categories[1]}</CatButton>
          <CatButton onClick={() => makeAppear(2)}>{categories[2]}</CatButton>
          <CatButton onClick={() => makeAppear(3)}>{categories[3]}</CatButton>
          <CatButton onClick={() => makeAppear(4)}>{categories[4]}</CatButton>
          <CatButton onClick={() => makeAppear(5)}>{categories[5]}</CatButton>
          <CatButton onClick={() => makeAppear(6)}>{categories[6]}</CatButton>
          <CatButton onClick={() => makeAppear(7)}>{categories[7]}</CatButton>
          <CatButton onClick={() => makeAppear(8)}>{categories[8]}</CatButton>
          <CatButton onClick={() => makeAppear(9)}>{categories[9]}</CatButton>
          <CatButton onClick={() => makeAppear(10)}>{categories[10]}</CatButton>
          <CatButton onClick={() => makeAppear(11)}>{categories[11]}</CatButton>
          <CatButton onClick={() => makeAppear(12)}>{categories[12]}</CatButton>
          <CatButton onClick={() => makeAppear(13)}>{categories[13]}</CatButton>
          <CatButton onClick={() => makeAppear(14)}>{categories[14]}</CatButton>
        </CategoryButtonArea>
    </div>
  )
}

const CatButton = styled.button`
  width: 24vw;
  height: 24vw;
  border-radius: 5px;
  font-size: 1.1rem;
`

const CategoryButtonArea = styled.div`
  display: grid;
  color: white;
  grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
  grid-template-columns: 1fr 1fr 1fr;
  justify-items: center;
  gap: 30px 20px;
  margin-top: 20vw;
  margin-bottom: 10vw;
  background-color: rgba(0,0,0,0);
  &.test {
    background-image: url('./images/fruit.jpg');
  }
`

const Spacer = styled.div`
  height: 10vw;
  opacity: 0;
`
